css:
body {
  font-family: Arial, sans-serif;
  margin: 0;
  padding: 0;
}

header {
  background-color: orange;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 20px;
}

header img {
  height: 50px;
}

nav {
  background-color: black;
  color: white;
}

nav ul {
  list-style: none;
  margin: 0;
  padding: 0;
  display: flex;
}

nav a {
  color: white;
  text-decoration: none;
  padding: 20px;
  display: block;
}

main {
  padding: 20px;
}

footer {
  background-color: black;
  color: white;
  text-align: center;
  padding: 20px;
}
